CREATE TABLE `tblpictureid` (
  `intExternalID` int(7) NOT NULL AUTO_INCREMENT,
  `vntImage` varchar(32) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  `strOwner` varchar(45) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`intExternalID`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;

CREATE TABLE `tblsectionschedule` (
  `intDaySlotID` tinyint(2) unsigned NOT NULL AUTO_INCREMENT,
  `strDayFormat` varchar(5) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`intDaySlotID`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=latin1;

CREATE TABLE `tblsectiontimes` (
  `intTimeSlotID` int(4) NOT NULL AUTO_INCREMENT,
  `timStartTime` time NOT NULL,
  `timEndTime` time NOT NULL,
  PRIMARY KEY (`intTimeSlotID`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=latin1;
